export default async function handler(req, res) {


  //const { summary, tokens } = req.body;
  //const body = await req.json();
  const body = req.body;
  console.log("BODY ", body);

  try {
    //const name = body.currentUrl.split("/").pop();
    const url = new URL(body.currentUrl);
    const name = url.pathname.substring(1);
    console.log("NAME ", name,);
    let data = {};
    // this is for testing knowledgebase...
    if (isValidUUID(name)) {
      const user = await getUserKnowledgebase(name);
      //console.log("USER ", user.Items)

      if (user.Items !== undefined && user.Items.length > 0) {
        data = user.Items[0];
        data['test-mode'] = true;
      } else {
        //return new Response(JSON.stringify({ message: `Unknown ${name}` }), { status: 400 });
        return res.status(400).json({ message: `Unknown ${name}` });
      }

    } else {
      //console.log("ENV ", process.env.NEXT_PUBLIC_APP_DEV);
      if (process.env.NEXT_PUBLIC_APP_DEV) {
        data = testUser;
      } else {
        const user = await getUser(name);
        if (user?.['Item'] === undefined) {
          //return new Response(JSON.stringify({ message: `Unknown ${name}` }), { status: 400 });
          return res.status(400).json({ message: `Unknown ${name}` });
        } else {
          data = user.Item;
          data['test-mode'] = false;
        }
      }
    }
    // return new Response(JSON.stringify({ result: { ...data, name } }), { status: 200 });
    return res.status(200).json({ result: { ...data, name } });
  } catch (err) {
    // promise rejects will be captured here... 
    console.log("Error", err);
    // return new Response(JSON.stringify({ error: err }), { status: 500 });
    return res.status(500).json({ error: err });
  }

}